// PaymentPage.js
import React, { useState, useContext } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { StoreContext } from "./StoreContext";
import "./PaymentPage.css";

const PaymentPage = () => {
  const { cart } = useContext(StoreContext);
  const navigate = useNavigate();
  const location = useLocation();

  // Get selected items and address passed from Checkout page
  const selectedItems = location.state?.selectedItems || cart;
  const selectedAddress = location.state?.selectedAddress || null;

  const [selectedPayment, setSelectedPayment] = useState("");

  // Calculate total
  const totalAmount = selectedItems.reduce(
    (sum, item) => sum + (item.price || 0) * (item.quantity || 1),
    0
  );

  // Handle Payment
  const handleProceedPayment = () => {
    if (!selectedPayment) {
      alert("Please select a payment method.");
      return;
    }

    // ✅ Navigate to Order Success page with state
    navigate("/order-success", {
      state: {
        items: selectedItems,
        address: selectedAddress,
        total: totalAmount,
      },
    });
  };

  return (
    <div className="payment-page">
      <h2>Payment Page</h2>

      {/* Cart Summary */}
      <div className="cart-summary">
        <h3>Cart Summary</h3>
        {selectedItems.map((item) => (
          <div className="cart-item" key={item.id}>
            <img src={item.image} alt={item.name} />
            <div>
              <p>{item.name}</p>
              <p>Qty: {item.quantity}</p>
              <p>Price: ₹{item.price * item.quantity}</p>
            </div>
          </div>
        ))}
        <h3>Total: ₹{totalAmount}</h3>
      </div>

      {/* Payment Options */}
      <div className="payment-options">
        <h3>Select Payment Method</h3>

        <label>
          <input
            type="radio"
            name="payment"
            value="PhonePe"
            onChange={(e) => setSelectedPayment(e.target.value)}
          />
          PhonePe
        </label>

        <label>
          <input
            type="radio"
            name="payment"
            value="EMI"
            onChange={(e) => setSelectedPayment(e.target.value)}
          />
          EMI
        </label>

        <label>
          <input
            type="radio"
            name="payment"
            value="Net Banking"
            onChange={(e) => setSelectedPayment(e.target.value)}
          />
          Net Banking
        </label>

        <label>
          <input
            type="radio"
            name="payment"
            value="Card"
            onChange={(e) => setSelectedPayment(e.target.value)}
          />
          Debit/Credit Card
        </label>

        {selectedPayment === "Card" && (
          <div className="card-details">
            <input type="text" placeholder="Name on Card" />
            <input type="text" placeholder="Card Number" />
            <input type="text" placeholder="Expiry Date (MM/YY)" />
            <input type="text" placeholder="CVV" />
          </div>
        )}
      </div>

      {/* Proceed Payment Button */}
      <button
        className="proceed-payment-btn"
        disabled={!selectedPayment}
        onClick={handleProceedPayment}
      >
        Proceed
      </button>
    </div>
  );
};

export default PaymentPage;
